def getMarker(str):
    st, dim = 0, 14
    # dim = 4 part 1
    for st in range(0, len(str) - dim):
        dr = st + dim
        window = str[st:dr]
        # if len(window) != 4:
        #  break

        if len(set(window)) == dim:
            return dr


print(
    getMarker(
        """"""
    )
)
